import Axios from "axios";
import {Button} from '../components/button'


function ImagesAPI() {

    const getImage = () => {
        Axios.get("https://api.unsplash.com/").then(
            (response) => {
                console.log(response);
            }
        )
    };

    return(
        <div>
        <Button onClick={getImage}> Pick Image </Button>
        </div>
    );

}

export default ImagesAPI;
